import { Route, Routes } from "react-router-dom";
import React from "react";
import SignUpPage from "./pages/SignUpPage";
import LoginPage from "./pages/LoginPage";
import NavigationBar from "./pages/NaviBar";
import Home from "./pages/home";
import Exercise from "./pages/exercise";
import RingImage from "styles/bt.png";
import Detail from "styles/detail.png";
import { Container, SignupFormContainer, Title } from "styles/SignupStyle";



const App = () => {
  const tabImageStyle = {
    width: '80%',
    height: '80%',
    margin: '7px'
  };

const handleRingImageClick = () => {
    window.location.href = "./ring";
  };
  const dimageClick = () => {
    window.location.href = "./exercise";
  };

const dimage = {
    width: '20px',
    height: '20px',
    margin: '5px'
  };

  return (
    <div>
      <NavigationBar />
      <Routes>
        <Route path="/signup" element={<SignUpPage />} />
        <Route path="/login" element={<LoginPage />} />
        <Route path="/home" element={<Home />} />
        <Route path="/exercise" element={<Exercise />} />

      </Routes>
      <Container>
      <SignupFormContainer>
        <div style={{ display: 'flex', alignItems: 'center' }}>
          <Title>안녕하세요, OOO님의 오늘의 목표 활동량은 0%입니다.</Title>
          <img
            src={Detail}
            alt="detail"
            style={dimage}
            onClick={dimageClick}
          />
        </div>

        <div style={{ display: 'flex', alignItems: 'center' }}>
          <img
            src={RingImage}
            alt="Ring"
            style={tabImageStyle}
            onClick={handleRingImageClick}
          />
        </div>
      </SignupFormContainer>
    </Container>
    </div>

  );
};
// app.js

fetch('/api/getData')
  .then(response => response.json())
  .then(data => {
    console.log('Data from server:', data);
    // 여기서 데이터를 활용
  })
  .catch(error => console.error('Error fetching data:', error));



export default App;
